# Read two integers from input and store them in variables named x and a.
x, a = map(int, input().split()) # map(int, input().split()) returns a list of integers

# If x is less than a, print 0; otherwise, print 10.
if x < a:
    print(0)
else:
    print(10)


def main():
    # read input
    x, a = [int(i) for i in input().split()]  # read input

    # compare the two values and print the result.
    if x < a:  # compare the two values
        print(0)  # print the result
    else:  # compare the two values
        print(10)  # print the result

if __name__ == '__main__':
    main()


